(1, 'Концерт пам''яті Володимира Висоцького', '<p><strong>Чому ми назвали наш п''ятий спектакль - концерт &laquo;Вертикаль&raquo;?</strong></p>\r\n<p><strong>По-перше:</strong><br /><br /><strong>Кінофільм &laquo;Вертикаль&raquo;</strong> - про життя альпіністів, за участю Володимира Висоцького в якості актора і виконавця своїх пісень, давно став культовим і улюбленим для величезної кількості самих різних людей. Всі пісні Висоцького, що увійшли у фільм - світові хіти, варто тільки заспівати їх у будь-якій російськомовній аудиторії, і всі відразу починають підспівувати.</p>\r\n<p><strong>По-друге:<br /></strong><br />Ми хочемо показати глядачам, як ріс і розвивався Володимир Семенович, і як змінювалися його пісні. Це якась життєва &laquo;вертикаль&raquo;. Від &laquo;блатних&raquo;, &laquo;дворових&raquo; пісень 1961 - 1967гг. до військових пісень, починаючи з 1963р. (1е відділення).<br />Від жартівливих і баладних пісень до ліричних, цивільних і філософських. (2е відділення).</p>\r\n<p><strong>По-третє:<br /></strong><br />Кожна людина від народження до старості проживає свою &laquo;вертикаль&raquo;. І які б таланти ми не отримали при народженні, всі ми штурмуємо свої вершини, сподіваємося на своїх друзів і повертаємося до своїм коханих. Зрозуміти відчути це вам допоможуть пісні і вірші Володимира Висоцького, а також чудові артисти і музиканти Київського театру поезії та пісні.</p>', 0, '25.08.2014 19:00', '25.06.2014 00:00', '25.08.2014 18:30', '25.07.2014 00:00', '3.jpg', '0bcb8a7adb1e386d9d2175a746b378b9.jpg', '/images/events/', 'a:27:{i:0;a:3:{s:11:"sector_name";s:15:" 1 Сектор";s:9:"sector_id";s:1:"1";s:12:"sector_price";s:3:"110";}i:1;a:3:{s:11:"sector_name";s:15:" 2 Сектор";s:9:"sector_id";s:1:"2";s:12:"sector_price";s:3:"800";}i:2;a:3:{s:11:"sector_name";s:15:" 3 Сектор";s:9:"sector_id";s:1:"3";s:12:"sector_price";s:2:"55";}i:3;a:3:{s:11:"sector_name";s:15:" 4 Сектор";s:9:"sector_id";s:1:"4";s:12:"sector_price";s:2:"50";}i:4;a:3:{s:11:"sector_name";s:15:" 5 С